.title[
# The power of multiple views for exploring diversity across phylogenetic scales
]
.author[
### Julia Fukuyama, Department of Statistics, Indiana University
]

---




### Suppose:

- We have measured abundances of a variety of taxa across different sites.
- We would like to quantify dissimilarities between sites.
- We would like our measure to take into account similarities among taxa (e.g. phylogenetic similarity).

--

### Problem:

- There are a lot of dissimilarity measures!
- Which one should we use?
- Why do the different distances give different results?

---

MDS representations of the enterotype dataset from the [phyloseq vignette](https://joey711.github.io/phyloseq/distance.html)

![](distance-summary-plot-1.png)

---

### In this talk

- &lt;span class="list-title"&gt;We make it worse!&lt;/span&gt; We introduce a continuous family of distances.
--

- &lt;span class="list-title"&gt;We (hopefully) make it better.&lt;/span&gt; We have a much better understanding of the differences between members of this family.
--

- &lt;span class="list-title"&gt;We have a lot of pictures.&lt;/span&gt; We demonstrate an R package (mpqDist) that makes it easy to make animated/interactive plots using members of this family.

---
layout:true

### Background

---

How can we quantify distances between communities?

- Most naive way: `\(\mathbf x, \mathbf y \in \mathbb R^p\)` are vectors of species abundances.
- Quantify dissimilarity between the two as the Euclidean distance, `\(\sqrt {(\mathbf x - \mathbf y)^T (\mathbf x - \mathbf y)}\)`

---

What if we think the species are not equally similar?

- Create a matrix of similarities, `\(\mathbf Q \in \mathbb R^{p\times p}\)`.
- Quantify dissimilarity as `\(\sqrt{(\mathbf x - \mathbf y)^T \mathbf Q (\mathbf x - \mathbf y)}\)`.

--

Many other ways of doing it, but this is related to Rao's proposal from the 80's ([Rao 1982](https://doi.org/10.1016/0040-5809%2882%2990004-1)) and is fairly straightforward.

The above is defined in terms of similarities, but this is motivated by dissimilarity between `\(\mathbf x\)` and `\(\mathbf y\)` being the average dissimilarity between an individual chosen at random from `\(\mathbf x\)` and an individual chosen at random from `\(\mathbf y\)`.

---
layout:true

`\(\mathbf Q_{ij}\)`, the similarity between species `\(i\)` and species `\(j\)`, is the branch length between the root and the most recent common ancestor of `\(i\)` and `\(j\)`.

---

![](q12.png)

---

![](q14.png)

--

This `\(\mathbf Q\)` is the covariance matrix that you would get for a quantitative trait undergoing Brownian motion on the phylogenetic tree.

This matrix was introduced in [Cavalli-Sforza and Piazza (1975)](https://doi.org/10.1016/0040-5809%2875%2990029-5).

---
layout:false

### Problem with `\(\mathbf Q\)`

- &lt;span class="list-title"&gt;Technical version:&lt;/span&gt; The top couple of eigenvectors of `\(\mathbf Q\)` tend to be associated with very large eigenvalues. (See [preprint](https://www.biorxiv.org/content/10.1101/2025.04.17.649379v1) for analytic forms of the eigenvectors/eigenvalues for perfect binary trees and approximations of eigenvectors/eigenvalues for the comb tree.)
--

- &lt;span class="list-title"&gt;Less technical version:&lt;/span&gt; Using `\(\mathbf Q\)` is similar to aggregating the taxon counts to a very coarse taxonomic level and computing the Euclidean distance on aggregated counts.
--

- &lt;span class="list-title"&gt;In terms of models of evolution:&lt;/span&gt; The people who build evolutionary models of quantitative traits know that in Brownian motion models, a lot of the trait variance comes from the distant past. This was part of the motivation for e.g. Ornstein-Uhlenbeck models of evolution.


---

### Implications

- Using the Brownian motion `\(\mathbf Q\)` implicitly emphasizes "basal" phylogenetic structure (like aggregating to phylum level).
- Is this good? Depends on the application.
- We want to be able to control how much emphasis is placed on basal structure.

---
layout: true

### How to control emphasis on basal structure

---

- Introduce a tuning parameter `\(r \in [0,1]\)`.
- For `\(r = 1\)`, this is the original distance, `\(\sqrt{(\mathbf x - \mathbf y)^T \mathbf Q(\mathbf x - \mathbf y)}\)`
- For `\(r = 0\)`, this is the Euclidean distance/no phylogenetic structure, `\(\sqrt{(\mathbf x - \mathbf y)^T \mathbf I(\mathbf x - \mathbf y)}\)`.
- In between we will have measures that are similar to aggregating to intermediate taxonomic levels.

---

Mathematically, we switch `\(\mathbf Q\)` for `\(\mathbf Q_r\)`, defined as:
$$
`\begin{aligned}
  \tilde{\mathbf{Q}}_r &amp;:= 
    \begin{cases}
      (r^{-1} \mathbf{I}_p + (1 - r)^{-1} \mathbf{Q}^{-1})^{-1} &amp; \text{if } r \in (0, 1) \\\\
      \mathbf{I}_p &amp; \text{if } r = 0 \\\\
      \mathbf{Q} &amp; \text{if } r = 1
    \end{cases} \\\\
  \mathbf{Q}_r &amp;:= \tilde{\mathbf{Q}}_r \big/ \text{trace}(\tilde{\mathbf{Q}}_r), \quad r \in [0,1].
\end{aligned}`
$$

---
layout: true

### How do we think about this family?

---

&lt;span class="list-title"&gt;Technically, modifying eigenvalues:&lt;/span&gt;
- When `\(r = 0\)`, this is the Euclidean distance, all eigenvalues are equal.
- When `\(r = 1\)`, this is the distance described before (using `\(\mathbf Q\)` from the Brownian motion model), top eigenvalues are very large.
- In between, eigenvalues are more equal, and we get continuous interpolation between Euclidean distance and `\(\mathbf Q\)`.

---

&lt;span class="list-title"&gt;Heuristically, it is similar to aggregating to different taxonomic levels:&lt;/span&gt;
- Large values of `\(r\)` are similar to aggregating to coarse taxonomic levels and computing distances.
- Small values of `\(r\)` are similar to aggregating to finer taxonomic levels and computing distances.

---
layout: false


### Example: Species turnover by latitude

[Gentry forest transect data](https://www.mobot.org/MOBOT/Research/gentry/transect.shtml), taken from [anadat-r website]({https://www.davidzeleny.net/anadat-r/doku.php/en:data:gentry).

For every site, we will compute its average distance to the northern temperate sites.

![](slides_files/figure-html/unnamed-chunk-1-1.png)&lt;!-- --&gt;





---

## The interactive version of this plot

Plotting average distance to northern temperate sites.


``` r
## gentry_log is a phyloseq object
mpq_distances &lt;-
*   get_mpq_distances(
        otu_table(gentry_log), phy_tree(gentry_log)
    )
temperate_samples &lt;- sample_names(gentry_log)[
    which(sample_data(gentry_log)$Lat &gt;= 23.5 &amp; sample_data(gentry_log)$Lat &lt;= 66.5)]
animation_df &lt;-
*   make_animation_df(
        mpq_distances, get_avg_distances_to_set, means_and_vars = NULL,
        temperate_samples, sample_data(gentry_log))
p &lt;- ggplot(aes(x = Lat, y = avg_dist), data = animation_df) +
    geom_point(aes(frame = frame)) +
    scale_x_reverse()
```

---


``` r
ggplotly(p)
```

### In conclusion

- Family of distances can emphasize "basal" or "terminal" phylogenetic structure.
- This is true of all distances that incorporate phylogenetic information, but for most it is not obvious whether they are basal or terminal measures.
- We don't have to use the family defined here to do so, could also modify branch lengths, use OU covariance instead of Brownian motion, just aggregate to different taxonomic levels (or something like [tip_glom](https://rdrr.io/bioc/phyloseq/man/tip_glom.html) in phyloseq).
- R package [mpqDist](https://github.com/jfukuyama/mpqDist) allows you to make interactive plots.
